import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import RegisterUserPage from "./pages/user/UserPage";

import PiratePage from "./pages/movie/Page/PageMovie";
import PiratesCreatePage from "./pages/movie/CreatePage/CreatePageMovie";
import PirateDetailPage from "./pages/movie/DetailPage/DetailPageMovie";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route
            path="/"
            element={<RegisterUserPage></RegisterUserPage>}
          ></Route>
          <Route path="/pirates" element={<PiratePage></PiratePage>}></Route>
          <Route
            path="/pirates/addPirate"
            element={<PiratesCreatePage></PiratesCreatePage>}
          ></Route>
          <Route
            path="/pirates/detailPirate/:idPirate"
            element={<PirateDetailPage></PirateDetailPage>}
          ></Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
